  \"digital-data-sets-that-describe-aquifer-characteristics-of-the-central-oklahoma-aquifer-in-centf167e\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of digitized polygons
  of a constant hydraulic conductivity value for the Central Oklahoma aquifer in central
  Oklahoma. This area encompasses all or part of Cleveland, Lincoln, Logan, Oklahoma,
  Payne, and Pottawatomie Counties. The Central Oklahoma aquifer includes the alluvial
  and terrace deposits along major streams, the Garber Sandstone and Wellington Formations,
  and the Chase, Council Grove, and Admire Groups. The Quaternary-age alluvial and
  terrace deposits consist of unconsolidated clay, silt, sand, and gravel. The hydraulic
  conductivity data set was created from digital data sets developed to produce a
  map for a previously published report. The hydraulic conductivity of the alluvial
  and terrace deposits are not included in this data set. This data set represents
  the hydraulic conductivities of only the sandstone units in the Garber Sandstone
  and Wellington Formations and the Chase, Council Grove, and Admire Groups. The median
  hydraulic conductivity of the sandstones in the Garber Sandstone and Wellington
  Formations and the Chase, Council Grove, and Admire Groups, calculated from specific
  capacity data, is 4.5 feet per day The contact between the Wellington Formation
  and the Chase, Council Grove, and Admire Groups was included in this data set because
  the median percentage of sandstone in the Chase, Council Grove, and Admire Groups
  is 43 percent of the median sandstone percentage of the Garber Sandstone and Wellington
  Formations. The hydraulic conductivity values for the other rock units, such as
  the siltstone, mudstone, shale, and limestone, in the Garber Sandstone and Wellington
  Formations and the Chase, Council Grove, and Admire Groups were not reported.\",\n\t\"license_title\":
