  \"access_constraints\",\n\t\t\"value\": \"[\"Use Constraints: This data set represents
  the hydraulic conductivities of only the sandstone units in the Garber Sandstone
  and Wellington Formations and the Chase, Council Grove, and Admire Groups described
  in Parkhurst, Christenson, and Breit (1996). The hydraulic conductivity values for
  the other rock units, such as the siltstone, mudstone, shale, and limestone, in
  the Garber Sandstone and Wellington Formations and the Chase, Council Grove, and
  Admire Groups are not known. Areas showing the hydraulic conductivity of the aquifer
  were digitized and published at a scale of 1:250,000 in the report by Christenson,
  Morton, and Mesander (1992). These areas represented at this scale are indicative
  of broad, regional trends and should not be interpreted as site specific.\", \"Access
